import React from 'react';
import Button from '../Button';
import Input from '../Input';
import styles from './ModalAdd.module.css';

const ModalAdd = ({ modalAdd, setModalAdd }) => {
  const [film, setFilm] = React.useState(null);
  const [genero, setGenero] = React.useState(null);
  const [duracao, setDuracao] = React.useState(null);
  const [foto, setFoto] = React.useState(null);
  return (
    <div className={styles.containerBackGround}>
      <div className={styles.container}>
        <div className={styles.containerAux}></div>
        <div>
          <Input
            type="text"
            placeholder="Filme"
            onChange={({ target }) => setFilm(target.value)}
          />
          <Input type="text" placeholder="Genero" />
          <Input type="text" placeholder="Duração" />
          <Input type="text" placeholder="Foto" />
          <Button text="Finish" onClick={() => setModalAdd(!modalAdd)} />
        </div>
      </div>
    </div>
  );
};

export default ModalAdd;
